const Header = (props) => {
  return(
    <h1>{props.course}</h1>
  )
}
const Part = (props) =>{
  return(
    <p>{props.part} {props.exercise}</p>
  )
}
const Content = (props) =>{
  const part1 = props.part1
  const part2 = props.part2
  const part3 = props.part3
  return(
  <div>
    <Part part={part1.name} exercise={part1.exercises1}/>
    <Part part={part2.name} exercise={part2.exercises2}/> 
    <Part part={part3.name} exercise={part3.exercises3}/> 
  </div>
  )
}
const Total = (props) =>{
  return(
   <p>Number of exercises {props.exercises1 + props.exercises2 
     +props.exercises3} </p>
  )
}
const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }
  return(
    <div>
      <Header course={course} />
      <Content part1={part1} part2={part2} part3={part3} />
      <Total exercises1={part1.exercises} exercises2={part2.exercises}
      exercises3={part3.exercises} />
    </div>
  )
}

export default App;
